fun findMaxSquareInMatrix(matrixArray: Array<IntArray>, n: Int, k: Int): Int {

    val row = n
    var tempArray = matrixArray
    val column = k
    var ans = 0

    for (i in row - 1 downTo 0) {
        for (j in column - 1 downTo 0) {
            if (i == row - 1 && j == column - 1) {
                tempArray[i][j] = matrixArray[i][j]
            } else if (i == row - 1) {
                tempArray[i][j] = matrixArray[i][j]
            } else if (j == column - 1) {
                tempArray[i][j] = matrixArray[i][j]
            } else {
                if (matrixArray[i][j] == 0) {
                    tempArray[i][j] = matrixArray[i][j];
                } else {
                    var temp = Math.min(matrixArray[i + 1][j], matrixArray[i][j + 1])
                    temp = Math.min(temp, matrixArray[i + 1][j + 1])
                    tempArray[i][j] = temp + 1

                }
            }
            if (ans < tempArray[i][j]) {
                ans = tempArray[i][j]
            }
        }
    }
    return ans
}


fun findMaxSquareInMatrixChar(matrix: Array<CharArray>): Int {

    val row = matrix.size
    var tempArray = matrix
    val column = matrix[0].size
    var ans = 0

    for (i in row - 1 downTo 0) {
        for (j in column - 1 downTo 0) {
            if (i == row - 1 && j == column - 1) {
                tempArray[i][j] = matrix[i][j]
            } else if (i == row - 1) {
                tempArray[i][j] = matrix[i][j]
            } else if (j == column - 1) {
                tempArray[i][j] = matrix[i][j]
            } else {
                if (matrix[i][j] == '0') {
                    tempArray[i][j] = matrix[i][j];
                } else {
                var temp = Math.min(matrix[i + 1][j].toString().toInt(), matrix[i][j + 1].toString().toInt())
                temp = Math.min(temp, matrix[i + 1][j + 1].toString().toInt())
                tempArray[i][j] = (101).toString().toCharArray()[0]
                }
            }
            if (ans < tempArray[i][j].toString().toInt()) {
                ans = tempArray[i][j].toString().toInt()
            }
        }
    }
    return ans*ans
}